import { useEffect, useState } from "react";

function ItemList() {
const [issues, setIssues] = useState([]);

useEffect (() => {
  fetch("http://localhost:8080/tasks")
  .then(resp => resp.json())
  .then(data => {
    setIssues(data.resp);
  })
  .catch(error => {
    console.error("Ошибка при получении данных:", error);
  });
}, []);

return (
  <div>
    <h2>Список:
      <ul>
        {issues.map((user, index) => (
          <li key={index}>
            Имя: {user.Name} 
              Чем занимается: {user.Do}
          </li>
        ))}
      </ul>
    </h2>
  </div>
);
}

export default ItemList;
